import { Routes } from '@angular/router';

export const routes: Routes = [
  {
    path: '',
    loadComponent: () => import('./home/home.component').then(c => c.HomeComponent)
  },
  {
    path: 'services',
    loadComponent: () => import('./services/services.component').then(c => c.ServicesComponent)
  },
  {
    path: 'gallery',
    loadComponent: () => import('./gallery/gallery.component').then(c => c.GalleryComponent)
  },
  {
    path: 'prices',
    loadComponent: () => import('./prices/prices.component').then(c => c.PricesComponent)
  },
  {
    path: 'contact',
    loadComponent: () => import('./contact/contact.component').then(c => c.ContactComponent)
  }
];
